  return (
    <form onSubmit={addExpenseButtonHadnler}>
      <div className="new-expense__controls">
        <div className="new-expense__actionss">
          <button type="submit">Add New Expense</button>
        </div>
      </div>
    </form>
  );
};

export default AddNewExpenseButton;
